import React from 'react';
import withData from "../HOC/withData";

const Speakers = ({speakers}) => {

    return (
        <div>
            {speakers.map(({imageSrc, name}) =>
                <img
                    src={`/images/${imageSrc}.png`}
                    alt={name}
                    key={imageSrc}
                />
            )}
        </div>
    )
};

export default withData(2)(Speakers);
